# encoding: utf-8
import json
import time
import requests


def get_stock_kline(code, period=101, limit=120, is_index=False):
    assert period in (5, 15, 30, 60, 101, 102, 103)
    if is_index:
        if str(code).startswith('0'):
            secid = f'0.{code}'
        elif str(code).startswith('3'):
            secid = f'1.{code}'
    else:
        if str(code)[0] in ('0', '1', '3'):
            secid = f'0.{code}'
        else:
            secid = f'1.{code}'
    url = f"http://67.push2his.eastmoney.com/api/qt/stock/kline/get"
    params = {
        'cb': "jQuery11240671737283431526_1624931273440",
        'secid': secid,
        'ut': 'fa5fd1943c7b386f172d6893dbfba10b',
        'fields1': 'f1,f2,f3,f4,f5,f6',
        'fields2': 'f51,f52,f53,f54,f55,f56,f57,f58,f59,f60,f61',
        'klt': period,
        'fqt': 0,
        'end': '20500101',
        'lmt': limit,
        '_': f'{int(time.time()) * 1000}'
    }
    try:
        r = requests.get(url, params=params).text
        r = r.split('(')[1].split(')')[0]
        r = json.loads(r)
        if 'data' in r.keys():
            if isinstance(r['data'], dict) and 'klines' in r['data'].keys():
                r = r['data']['klines']
                data = []
                for i in range(len(r)):
                    tmp = {}
                    current_data = r[i].split(',')
                    tmp['day'] = current_data[0]
                    tmp['close'] = float(current_data[2])
                    tmp['high'] = float(current_data[3])
                    tmp['low'] = float(current_data[4])
                    if i > 0:
                        tmp['last_close'] = float(r[i - 1].split(',')[2])
                    data.append(tmp)
                return data[1:]
    except Exception() as e:
        print(e)
        return None



# 计算平均值
def mean(x):
    return sum(x) / len(x)

# 计算每一项数据与均值的差
def de_mean(x):
    x_bar = mean(x)
    return [x_i - x_bar for x_i in x]

# 辅助计算函数 dot product 、sum_of_squares
def dot(v, w):
    return sum(v_i * w_i for v_i, w_i in zip(v, w))

def sum_of_squares(v):
    return dot(v, v)

# 方差
def variance(x):
    n = len(x)
    deviations = de_mean(x)
    return sum_of_squares(deviations) / (n - 1)

# 标准差
def standard_deviation(x):
    import math
    return math.sqrt(variance(x))

# 协方差
def covariance(x, y):
    n = len(x)
    return dot(de_mean(x), de_mean(y)) / (n - 1)


# 相关系数
def correlation(x, y):
    stdev_x = standard_deviation(x)
    stdev_y = standard_deviation(y)
    if stdev_x > 0 and stdev_y > 0:
        return covariance(x, y) / stdev_x / stdev_y
    else:
        return 0




